style.css:
@-moz-document domain("onelogin.com") {
 #apps-view-container .scrollable-content {
 	background-color: #272B33;
 }

 #apps-view-container .search-and-tabs-wrap {
 	background-color: #2c323d;
 	border-color: #5b626f;
 }

 .tb-wrapper #tb-container {
 	background-color: #2c323d !important;
 }

 .tabs-view-switcher.top-switcher .tab-item.active-item .tab-item-content,
  .admin-link a:hover,
  .admin-and-menu div:hover {
 	color: #abb2c0;
  }

  .tabs-view-switcher.top-switcher .tab-item .tab-item-content,
  .admin-link a,
  .admin-and-menu div {
 	color: #5b626f;
  }

  .link-button {
 	color: #61AFEF;
  }

  .link-button:hover {
 	color: #65b6f8;
  }

  .app-cell-wrapper .app-cell,
  .app-cell-wrapper .app-cell .centered-image,
  .app-cell-wrapper .app-cell .app-cell-appname,
  .app-cell-wrapper .app-cell.selected .app-cell-appname {
    background-color: #3e4451;
    border-color: #5b626f;
    color: #abb2c0;
  }

  .app-cell-wrapper .app-cell.selected {
    border-color: #65b6f8;
  }

  input,
  input:focus {
    background-color: #3e4451;
  }

  input:focus {
    color: #abb2c0;
  }
}
